import React, {Component} from 'react';
import './App.css';
import Header from './components/Header'
import Storydisplay from './components/Storydisplay'
import Iframe from 'react-iframe'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <iframe data-aa="803470" src="//acceptable.a-ads.com/803470" scrolling="no" style="border:0px; padding:0; width: 100%; height: 100%; overflow:hidden" allowtransparency="true"></iframe> 
        <Storydisplay />

      </div>
    );
  }
}

export default App;
